import React from "react";
import { FaTrash } from 'react-icons/fa';
function Note(props) {
  function handleClick() {
    props.onDelete(props.id);
  }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={handleClick}><FaTrash /></button>
    </div>
  );
}

export default Note;
